        return charList[randomNum()]
    }

    const randomizeThenDisplay = (original) => {

        let orig = original

        function randomizeWord() {
            let splitArr = orig.split('')
            let randomArr = []
            for(let i = 0; i < splitArr.length; i++) {
                randomArr.push(randomLetter(orig[i]))
